Ad Text:
12 + 12 + 12 Month Start Asap
Canberra Onsite - Hybrid/WHF Considered
Working on complex digital/data projects - Agile 

Our client, a large Federal Government Department responsible for consolidating the government's efforts to drive economic growth productivity and competitiveness by bringing together Industry, Energy, Resources and Science require the services of a Senior Business Analyst.

Duties of the Senior Business Analyst

Develop requirements & artefacts for complex IT systems including website development;
Analyse & model current and future business processes & information management environments:
Analyse data related requirements, user pathways & information flows;
Conduct stakeholder engagement activities;
Develop clear & concise documents including functional & non-functional specifications as well as communication & change management plans;
Investigations & research & analysis aligning them with departmental policies & legislations;
Analyse & Evaluate options for solutions from a strategical viewpoint (custom and configured) & translate business requirements into technical & functional requirements.

Skills and Experience Required

Experience facilitating workshops & analysing complex information from a range of sources; 
Experience in developing User Stories & acceptance criteria that clearly & succinctly specifies the information developers and testers require to deliver & test solutions;
Experience working on complex digital projects in an Agile environment to account for interdependencies & support team workflows;
Excellent stakeholder engagement, communication & presentation skills.
Experience documenting requirements for Sitecore (desired);
Experience using Azure DevOps for user story creation and tracking of acceptance criteria (desired);
Experience or knowledge of Dynamics 365 or Power Platform, Azure Cloud & Google Analytics (desired).

